import React, { useState } from "react";
import { CSSTransition } from "react-transition-group";
import '../ModalAnimations.css'

const SearchModal = ({ isOpen, doSearh, musics }) => {

    return (
        <CSSTransition
            in={isOpen}
            timeout={300}
            classNames="search"
            unmountOnExit>
            <div className="fixed inset-0 bg-[#FFFFFFAB;] h-[80px] mt-[105px] right-10">
                <div className="">
                    <div>
                        <ul>{doSearh.map((musics) => (
                            <button
                                onClick={openWindow}
                                className="flex flex-nowrap w-full">
                                <div className="h-[50px] w-[50px]">
                                    <img className='rounded-lg' src={props.post.img} alt="Картина песни" />
                                </div>
                                <div className="ml-[26px] flex flex-col">
                                    <div className="pb-0 h-[20px] font-medium text-gray-950">
                                        {props.post.title}
                                    </div>
                                    <div className="h-[20px] text-gray-700">
                                        {props.post.authorName}
                                    </div>
                                </div>
                            </button>

                        ))}</ul>
                    </div>
                </div>
            </div>


        </CSSTransition>
    )
}

export default SearchModal;
